import java.util.*;

public class minimumWindowSubstring76 {
	
	public static void main (String [] args) {
		
		String a = "";
		String b = "";
		System.out.println(minWindow("ADOBECODEBANC", "ABC"));
		
	}
	
	public static String minWindow(String s, String t) {
		
		if (t.equals(s)) return t;
		if (s.length() < t.length()) return "";
		
		int res = Integer.MAX_VALUE;
		int [] indexes = new int[2]; 
		
		HashMap<Character, Integer> count = new HashMap<>();
		HashMap<Character, Integer> window = new HashMap<>(); 
		
		for (char c: t.toCharArray()) {
			count.put(c, count.getOrDefault(c, 0) + 1);
		}
		
		int have = 0;
		int need = count.size();
		int l = 0;
		
		for (int r = 0; r < s.length(); r++) {
			
			char c = s.charAt(r);

			window.put(c, window.getOrDefault(c, 0) + 1);
			
			if (count.containsKey(c) && Integer.valueOf(count.get(c)).equals(Integer.valueOf(window.get(c)))) {
				have++;
			}
			
			while (have == need) {
				
				if (r-l+1 < res) {
					res = r - l + 1;
					indexes[0] = l;
					indexes[1] = r;
				}
				
				window.put(s.charAt(l), Integer.valueOf(window.get(s.charAt(l))) - 1);
				
				if (count.containsKey(s.charAt(l)) && Integer.valueOf(count.get(s.charAt(l))) > Integer.valueOf(window.get(s.charAt(l)))) {
					have--;
				}
				l++;		
			}	
		}
		if (res == Integer.MAX_VALUE) {
			return "";
		}
		else {
			return s.substring(indexes[0], indexes[1]+1);
		}
	}
	
}
